sys_variable_value.value:
(function execute(inputs, outputs) {

  var gr=new GlideRecord("change_request");
  var fieldsObj=JSON.parse(inputs.fields);

  gr.newRecord();
  for (var key in fieldsObj) {   	
    gr.setValue(key, fieldsObj[key])
  }
  gr.update();
  gs.info("Change request created: " + gr.getValue("number"));
  outputs.cr_number=gr.getValue("number");
  outputs.record=gr;
})(inputs, outputs);

